import React from "react";


interface PostFormProps {

}

export class PostForm extends React.Component<PostFormProps> {

    render () {

        return (
            <div>
                <h1> Submit a request to Reserve space </h1> 
                <form>
                    <div>
                        <label> UserID </label>
                        <input type='text' id='UID' name='userId' />
                    </div>
                    <div>
                        <label> Title </label>
                        <input type='text' name='title'/>
                    </div>
                    <div>
                        <label> Body </label>
                        <input type='text' name='body'/>
                    </div>
                </form>

            </div>
        )
    }
}

export default PostForm;
